import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { FiSearch, FiMapPin, FiGlobe, FiSun, FiCompass, FiStar } from 'react-icons/fi';
import { FaUmbrellaBeach, FaCity, FaShip, FaMountain } from 'react-icons/fa';
import './App.css';

// Helper component for rendering stars
const StarRating = ({ rating }) => (
  <div className="stars">
    {[...Array(5)].map((_, i) => (
      <FiStar 
        key={i} 
        className={i < Math.floor(rating) ? 'filled' : ''} 
      />
    ))}
    <span>{rating}</span>
  </div>
);

// Fallback image in case remote images fail to load
const fallbackImage = 'https://images.unsplash.com/photo-1501785888041-af3ef285b470?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1000&q=80';

const popularSightseeings = [
  {
    id: 1,
    name: 'Phi Phi Island',
    location: 'Phuket, Thailand',
    rating: 4.8,
    reviews: 1245,
    icon: <FaUmbrellaBeach />,
    image: 'https://images.unsplash.com/photo-1552465011-b4e21bf6e79a?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2000&q=80',
    description: 'Experience the stunning beauty of Phi Phi Islands with crystal clear waters and white sandy beaches.'
  },
  {
    id: 2,
    name: '4 Island Tour',
    location: 'Krabi, Thailand',
    rating: 4.7,
    reviews: 987,
    icon: <FaShip />,
    image: 'https://images.unsplash.com/photo-1501785888041-af3ef285b470?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2000&q=80',
    description: 'Discover four beautiful islands in one day, perfect for snorkeling and beach lovers.'
  },
  {
    id: 3,
    name: 'Phuket City Tour',
    location: 'Phuket, Thailand',
    rating: 4.5,
    reviews: 876,
    icon: <FaCity />,
    image: 'https://images.unsplash.com/photo-1527631746610-bca00a040d60?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2000&q=80',
    description: 'Explore the rich culture and history of Phuket city with our guided tour.'
  },
  {
    id: 4,
    name: 'Bangkok Dinner Cruise',
    location: 'Bangkok, Thailand',
    rating: 4.9,
    reviews: 1567,
    icon: <FaShip />,
    image: 'https://images.unsplash.com/photo-1566073771259-6a8506099945?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1000&q=80',
    description: 'Enjoy a romantic dinner cruise along the Chao Phraya River with stunning city views.'
  },
  {
    id: 5,
    name: '7 Island Tour',
    location: 'Phang Nga Bay, Thailand',
    rating: 4.9,
    reviews: 1342,
    icon: <FaUmbrellaBeach />,
    image: 'https://images.unsplash.com/photo-1552465011-b4e21bf6e79a?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1000&q=80',
    description: 'Explore seven stunning islands in Phang Nga Bay, famous for their limestone cliffs and emerald-green waters.'
  },
  {
    id: 6,
    name: 'Manokahan Tower Tour',
    location: 'Chiang Mai, Thailand',
    rating: 4.8,
    reviews: 2103,
    icon: <FaMountain />,
    image: 'https://images.unsplash.com/photo-1502602897457-9152bb778b11?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1000&q=80',
    description: 'Visit the famous Manokahan Tower for breathtaking panoramic views of Chiang Mai and its surrounding mountains.'
  }
];

function App() {
  const [searchQuery, setSearchQuery] = useState('');
  const [filteredSightseeings, setFilteredSightseeings] = useState(popularSightseeings);
  const [activeFilter, setActiveFilter] = useState('all');

  useEffect(() => {
    const results = popularSightseeings.filter(sightseeing =>
      sightseeing.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
      sightseeing.location.toLowerCase().includes(searchQuery.toLowerCase()) ||
      sightseeing.description.toLowerCase().includes(searchQuery.toLowerCase())
    );
    setFilteredSightseeings(results);
  }, [searchQuery]);

  const handleFilter = (filter) => {
    setActiveFilter(filter);
    if (filter === 'all') {
      setFilteredSightseeings(popularSightseeings);
    } else {
      const results = popularSightseeings.filter(
        sightseeing => sightseeing.location.toLowerCase().includes(filter)
      );
      setFilteredSightseeings(results);
    }
  };

  const handleImageError = (e) => {
    e.target.style.backgroundImage = `url(${fallbackImage})`;
  };

  return (
    <div className="app">
      <nav className="navbar">
        <div className="logo">Navigatio Asia DMC</div>
        <div className="nav-links">
          <a href="#home">Home</a>
          <a href="#destinations">Destinations</a>
          <a href="#about">About Us</a>
          <a href="#contact">Contact</a>
        </div>
      </nav>

      <main>
        <section className="hero-video" id="home">
          <div className="video-background">
            <video autoPlay loop muted playsInline>
              <source src="/video/Final_Logo_Animation_Match.mp4" type="video/mp4" />
              Your browser does not support the video tag.
            </video>
          </div>
        </section>

        <div className="spacer"></div>

        <section className="search-section">
          <div className="search-container">
            <motion.div 
              className="search-header"
              initial={{ opacity: 0, y: -20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5 }}
              viewport={{ once: true }}
            >
              <h2>Popular Sightseeings</h2>
              <p>Explore our most popular tours and activities</p>
            </motion.div>

            <motion.div 
              className="search-box"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.2 }}
            >
              <div className="search-input">
                <FiSearch className="search-icon" />
                <input 
                  type="text" 
                  placeholder="Search for sightseeings, destinations..." 
                  value={searchQuery}
                  onChange={(e) => setSearchQuery(e.target.value)}
                />
              </div>
              <button className="search-button">Search</button>
            </motion.div>

            <div className="filters">
              <button 
                className={`filter-btn ${activeFilter === 'all' ? 'active' : ''}`}
                onClick={() => handleFilter('all')}
              >
                All
              </button>
              <button 
                className={`filter-btn ${activeFilter === 'phuket' ? 'active' : ''}`}
                onClick={() => handleFilter('phuket')}
              >
                Phuket
              </button>
              <button 
                className={`filter-btn ${activeFilter === 'bangkok' ? 'active' : ''}`}
                onClick={() => handleFilter('bangkok')}
              >
                Bangkok
              </button>
              <button 
                className={`filter-btn ${activeFilter === 'krabi' ? 'active' : ''}`}
                onClick={() => handleFilter('krabi')}
              >
                Krabi
              </button>
            </div>

            <div className="sightseeings-grid">
              <AnimatePresence>
                {filteredSightseeings.map((sightseeing) => {
                  const [imageLoaded, setImageLoaded] = useState(false);

                  return (
                    <motion.div 
                      key={sightseeing.id} 
                      className="flip-card"
                      whileHover={{ scale: 1.03 }}
                      whileTap={{ scale: 0.98 }}
                    >
                      <div className="flip-card-inner">
                        <div 
                          className="flip-card-front" 
                          style={{ 
                            backgroundImage: `url(${imageLoaded ? sightseeing.image : fallbackImage})`,
                            backgroundSize: 'cover',
                            backgroundPosition: 'center',
                            backgroundRepeat: 'no-repeat'
                          }}
                        >
                          <img 
                            src={sightseeing.image} 
                            alt={sightseeing.name} 
                            onLoad={() => setImageLoaded(true)}
                            style={{ display: 'none' }}
                          />
                          <div className="card-content">
                            <h3>{sightseeing.name}</h3>
                            <p className="location">
                              <FiMapPin /> {sightseeing.location}
                            </p>
                          </div>
                        </div>
                        <div className="flip-card-back">
                          <div className="card-back-content">
                            <div className="card-icon">
                              {sightseeing.icon}
                            </div>
                            <h3>{sightseeing.name}</h3>
                            <p className="description">{sightseeing.description}</p>
                            <div className="rating">
                              <div className="stars">
                                {[...Array(5)].map((_, i) => (
                                  <FiStar 
                                    key={i} 
                                    className={i < Math.floor(sightseeing.rating) ? 'filled' : ''} 
                                    style={{ 
                                      color: i < Math.floor(sightseeing.rating) ? '#F59E0B' : '#E2E8F0',
                                      marginRight: '2px'
                                    }}
                                  />
                                ))}
                                <span>{sightseeing.rating}</span>
                              </div>
                              <span className="reviews">({sightseeing.reviews} reviews)</span>
                            </div>
                            <button className="view-details">View Tour Details</button>
                          </div>
                        </div>
                      </div>
                    </motion.div>
                  );
                })}
              </AnimatePresence>
            </div>
          </div>
        </section>

        <section className="features" id="destinations">
          <h2>Why Choose Navigatio Asia DMC?</h2>
          <div className="features-grid">
            <motion.div 
              className="feature-card"
              whileHover={{ y: -10, boxShadow: '0 15px 30px rgba(0,0,0,0.1)' }}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5 }}
            >
              <div className="feature-icon">
                <FiGlobe />
              </div>
              <h3>Expert Local Knowledge</h3>
              <p>Our team of local experts ensures authentic experiences that go beyond the typical tourist trails.</p>
            </motion.div>

            <motion.div 
              className="feature-card"
              whileHover={{ y: -10, boxShadow: '0 15px 30px rgba(0,0,0,0.1)' }}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.1 }}
            >
              <div className="feature-icon">
                <FiSun />
              </div>
              <h3>Tailor-Made Itineraries</h3>
              <p>Customized travel plans designed specifically for your interests, pace, and preferences.</p>
            </motion.div>

            <motion.div 
              className="feature-card"
              whileHover={{ y: -10, boxShadow: '0 15px 30px rgba(0,0,0,0.1)' }}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.2 }}
            >
              <div className="feature-icon">
                <FiCompass />
              </div>
              <h3>24/7 Support</h3>
              <p>Round-the-clock assistance throughout your journey for a worry-free experience.</p>
            </motion.div>
          </div>
        </section>
      </main>

      <footer>
        <div className="footer-content">
          <div className="footer-section">
            <h3>Navigatio Asia DMC</h3>
            <p>Creating unforgettable travel experiences across Asia since 2010.</p>
          </div>
          <div className="footer-section">
            <h4>Contact Us</h4>
            <p>Email: info@navigatioasia.com</p>
            <p>Phone: +1 (555) 123-4567</p>
          </div>
          <div className="footer-section">
            <h4>Follow Us</h4>
            <div className="social-links">
              <a href="#">Facebook</a>
              <a href="#">Instagram</a>
              <a href="#">Twitter</a>
            </div>
          </div>
        </div>
        <div className="footer-bottom">
          <p>&copy; {new Date().getFullYear()} Navigatio Asia DMC. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
}

export default App;
